INSERT INTO `sector` VALUES (1,'Agricultura, ganadería, silvicultura y otros usos de la tierra','#54bdb4','En el sector se incluyen las emisiones y absorciones de tierras forestales, tierras de cultivo, pastizales, humedales, asentamientos y otras tierras. También incluye las emisiones por la gestión de ganado vivo y de estiércol, las emisiones de los suelos gestionados y las emisiones de las aplicaciones de fertilizantes. '),(2,'Energía','#f44652','Este sector incluye todas las emisiones de GEI que emanan de la combustión y las fugas de combustibles. Las emisiones de usos no energéticos de combustibles no suelen incluirse en este sector, sino que se declaran dentro de Procesos industriales y uso de productos.'),(3,'Procesos industriales y uso de productos','#f87652','Este sector incluye todas las emisiones de GEI generadas como resultado de la reacción entre materias primas empleadas en diferentes procesos químicos.'),(4,'Residuos','#9189b8','En el sector se incluyen las emisiones de GEI que se generan debido a la disposición, tratamiento y gestión de residuos sólidos y aguas residuales. ');
